import rangeDate from "../utils/rangeDate"

const Schedule = () => {
  const data = rangeDate(1, 16)

  return (
    <div className="frame">
      <div className="chedule-header">headers</div>
      <div className="frame-grid">
        <div className="time">time left</div>
        <div className="grid">grid</div>
        <div className="time">nime right</div>
      </div>
    </div>
  )
}

export default Schedule
